// App.js
import React from "react";
import KanbanBoard from "./Components/kanbanBoard";
import "./App.css";

function App() {
  return (
    <div className="app">
      <div className="app_nav">
        <h1>Kanban Board</h1>
      </div>
      <div className="app_boards_container">
        <KanbanBoard />
      </div>
    </div>
  );
}

export default App;
